import "./scss/app.scss";
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import Employees from "./components/Employees/Employees";
import {data} from "./helper/data"




function App() {
  return (
    <>
<Header />
<Employees data={data} />
<Footer/>
    </>

  );
}

export default App;
